import{_ as a}from"./chunks/index.VAya1KE4.js";import{c as p,o as s,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const r=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":501214,"idList":[504621,504570,504440,501214,503614,501157,501213,6489,3386,1058,1433,1056,1220,1498,503613,503612,4074,4073,500207,1290,502928,502927,5111,1627,502306,500987,501624,2404,501625,501626,2142,4334,6180,59,75,1057,501441,4081,500419,5020,500291,5865,500286,6937,500673,4780,5494,3875,3564,3276,1360,2040,57,2123,2403,2124,55,111,1744,501212,500672,500605,500292,7257,6938,6594,6490,6285,5866,5493,5297,4781,4736,4333,4197,4148,3387,3275,2606,2125,2402,78,382,105,92,241,1221,54,644,56,61,112,76,79,1055,1291,1795,2415],"data":{"id":501214,"name":"希格雯","summary":"圣洁之灵，请听我愿，希格雯，美露莘，护士长","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/07/16/195563531/b517758b373bfdc2afa3a93e0f68381f_4356070929918876023.png","avatar":{"m":"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/d24ce25aa3a86e9a8f4aca47e5934e6d_1273253205334326194.png","pc":"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/eb0666bc4ea5b48573b9cded66bb0b7b_9010611719960132052.png"},"attrs":[["地区","枫丹廷"],["星级","五星"],["神之眼所属","枫丹"],["元素","水"],["武器","弓"],["始基力","荒"],["生日","3月30日"],["所属","梅洛彼得堡"],["定位","治疗辅助型角色"],["武器类型","弓"],["命之座","海精座"],["称号","龙女妙变"]],"destiny":[["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/840cf9fce008674f7747ffe5525ea2e3_9085191983211853176.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/840cf9fce008674f7747ffe5525ea2e3_9085191983211853176.png\\" style=\\"width: 40px\\"></span></span></span>「最快乐的精灵，可否懂得焦虑」</p>","<p>弹跳水疗法的激愈水球能额外弹跳3次；</p><p>前3次弹跳不会使较大激愈水球变小。</p><p>此外，固有天赋「应有适当的休憩」的效果获得提升：</p><p>激愈水球弹跳时，将为希格雯赋予1层静养计数，并使静养计数产生的伤害值提升改为：</p><p>希格雯的生命值上限超过30000的部分，每1000点生命值上限将提升100点，通过这种方式，至多提升3500点伤害。</p><p>此效果需要解锁固有天赋「应有适当的休憩」。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/fac0fdc68f91746393b9418fcec93ad9_7249533682104219741.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/fac0fdc68f91746393b9418fcec93ad9_7249533682104219741.png\\" style=\\"width: 40px\\"></span></span></span>「最仁慈的精灵，可否化解仇敌」</p>","<p>施放弹跳水疗法与过饱和心意注射时，将生成一个伤害吸收量等同于生命值上限30%的水球护盾，对水元素伤害有250%的吸收效果，持续直到施放完成。</p><p>此外，弹跳水疗法抛出的激愈水球或过饱和心意注射命中敌人后，该敌人的水元素抗性降低35%，持续8秒。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/970cd0295e83d1c2514e8ee2a757ffbd_4968466551370810100.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/970cd0295e83d1c2514e8ee2a757ffbd_4968466551370810100.png\\" style=\\"width: 40px\\"></span></span></span>「最健康的精灵，可否疗愈热症」</p>","<p>弹跳水疗法的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/3e10e049cab4c72412d298643a1abfeb_7988307356377657241.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/3e10e049cab4c72412d298643a1abfeb_7988307356377657241.png\\" style=\\"width: 40px\\"></span></span></span>「最美丽的精灵，可否拒绝衰朽」</p>","<p>过饱和心意注射的持续时间延长3秒。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/9d3dffd9c5f59b33cdd7da03a3c05aa3_8806788256874511114.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/9d3dffd9c5f59b33cdd7da03a3c05aa3_8806788256874511114.png\\" style=\\"width: 40px\\"></span></span></span>「最幸福的精灵，可否消却折磨」</p>","<p>过饱和心意注射的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/e4dc6b31c61700bf26fee9c111b08a8d_1958554470927156138.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/e4dc6b31c61700bf26fee9c111b08a8d_1958554470927156138.png\\" style=\\"width: 40px\\"></span></span></span>「最光辉的精灵，可否为我祷告」</p>","<p>希格雯进行治疗时，将基于生命值上限，提升自己的过饱和心意注射的暴击率和暴击伤害：每1000点生命值上限都将提升0.4%暴击率与2.2%暴击伤害，持续15秒。至多通过这种方式提升20%暴击率与110%暴击伤害。</p>"]],"skill":[{"title":"普通攻击·靶向治疗","desc":"普通攻击\\n进行至多三段的连续攻击。\\n\\n重击\\n进行伤害更高、更为精准的瞄准射击。\\n瞄准时，水元素之力会在箭矢上持续积聚。蓄力完成后，每隔一段时间，希格雯会向目标方向发射缓慢移动的「小小关心气泡」，造成水元素伤害。释放时，聚满了激流的箭矢会在命中敌人时造成水元素伤害。\\n\\n下落攻击\\n从空中射出箭雨，并迅速下坠冲击地面，在落地时造成范围伤害。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/2fdd4e70d04a880935e45f3941ee924a_1725217498546520180.png"},{"title":"弹跳水疗法","desc":"使用梅洛彼得堡特制的泡泡枪，吹出既可以刺激血液循环、也可以让病人安心入睡的激愈水球。\\n激愈水球将在附近的敌人间弹跳，命中敌人时基于希格雯的生命值上限，造成水元素伤害；\\n弹跳时，为队伍中附近除希格雯自己外的所有角色恢复生命值，回复量受益于希格雯自己的生命值上限。\\n进行5次弹跳后，激愈水球将消失，并基于希格雯的生命值上限为她恢复生命值。\\n没有敌人时，激愈水球将在附近进行弹跳。\\n至多同时存在一个希格雯自己创造的激愈水球。\\n长按时，能蓄力施放激愈水球。\\n\\n长按\\n进行瞄准蓄力，吹出更大更厉害的激愈水球！\\n激愈水球将随长按时间变大，至多变大二级，每级将使造成的伤害提升5%，回复量提升5%；\\n弹跳后将变小一个等级，直到恢复为正常的激愈水球。\\n较弱的敌人被较大的激愈水球命中后会被禁锢，无法行动。\\n\\n此外，施放时将在希格雯附近产生2枚源水之滴。每拾取一枚源水之滴，都会为希格雯自己赋予生命值上限10%的生命之契。\\n希格雯的生命之契被清除时，每清除2000点生命之契将为她恢复1点元素能量，至多通过这种方式为希格雯自己恢复5点元素能量。\\n\\n始基力：荒性\\n每隔一段时间，激愈水球将在命中的位置降下流涌之刃，基于希格雯的生命值上限，造成具有荒性的水元素伤害。\\n\\n「怎么样，用这样的水疗法，既能刺激循环，又能让复健的病人感受到乐趣，而且，也会让应该睡着的病人好好睡一会儿呢…」","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/6b68070f10d1d4810c3b798ab78ae8f8_6563013123445706283.png"},{"title":"过饱和心意注射","desc":"取出梅洛彼得堡特制的注射器，以满满的心意与药剂冲击前方区域，基于希格雯的生命值上限，持续造成水元素范围伤害。\\n此外，施放时，希格雯将吸收附近一定范围内至多2枚源水之滴。\\n\\n「啊呀，超过剂量的药与毒无异，可是很危险的，但是病人需要的关心与爱护，不管超过多少也不为过哦。」","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/1c056db523a772a5adf68118562b1c3b_7540552678065729795.png"},{"title":"应有适当的休憩","desc":"施放弹跳水疗法时，希格雯将为自己施加持续18秒的「半强制静养」效果：\\n持续期间，希格雯获得8%水元素伤害加成与10层静养计数，除希格雯外附近队伍中处于后台的角色的元素战技造成伤害时，将消耗1层静养计数，提升此次元素战技造成的伤害值：\\n希格雯的生命值上限超过30000的部分，每1000点生命值上限将提升80点伤害，通过这种方式，至多使本次元素战技造成的伤害提升2800点。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/34bf561213d92e9c6327a41a0ae61067_3485808609788608032.png"},{"title":"细致入微的诊疗","desc":"希格雯进行治疗时，将基于队伍中所有角色当前生命之契的总和，提升本次治疗量：每1000点生命之契都将提升3%治疗量，至多通过这种方式提升30%治疗量。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/6d437d13d8797dd535a014a0a4a41909_6118191766024023395.png"},{"title":"急性剂量","desc":"在水下时，当前场上自己的角色的生命值降低至50%以下时，将在2.5秒内为其持续恢复生命值，总回复量相当于其生命值上限的50%，并在10秒内使该角色的所有元素抗性和物理抗性下降10%。该效果每20秒最多触发一次。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/19/4328207/0e0332dc13f1bcd6c2b698879de4bb2e_1999418798054451035.png"}]},"favModalLocalKey":"vitepress_game_ys_role_fav_modal","favLocalKey":"vitepress_game_ys_role_fav"},"relativePath":"game/ys/role/501214.md","filePath":"game/ys/role/[pkg].md"}'),i={name:"game/ys/role/501214.md"},g=Object.assign(i,{setup(c){return(o,d)=>(s(),p("div",null,[e(t(a))]))}});export{r as __pageData,g as default};
